import React from 'react'
import {NavLink} from 'react-router-dom';

const Navbar = () => {
    const styles = {
        height:"50px",
        width:"100%",
        border:"1px solid aquamarine",
        padding:"5px",
    }
    const style1  = {
      float:"left"
    };
    const style2 = {
      float :"right",
      marginRight:"20px"
    }
  return (
    <div style={styles}>
        <div style= {style1}><h3 style={{"width":"50%","color":"purple"}}>Instaclone</h3></div>
        <NavLink to = "/addpost"><div style = {style2}><img height="50px" src={process.env.PUBLIC_URL + '/thumb.png'} alt="camera" /></div></NavLink>
    </div>
  )
}

export default Navbar
